import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 46.2-214 Charges for information supplied by Department.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-214.md","filePath":"vacode/46.2-214.md"}'),o={name:"vacode/46.2-214.md"},i=r('<h1 id="§-46-2-214-charges-for-information-supplied-by-department" tabindex="-1">§ 46.2-214 Charges for information supplied by Department. <a class="header-anchor" href="#§-46-2-214-charges-for-information-supplied-by-department" aria-label="Permalink to &quot;§ 46.2-214 Charges for information supplied by Department.&quot;">​</a></h1><p>The Commissioner may make a reasonable charge for furnishing information under this title, but no fee shall be charged to any official of the Commonwealth, including court and police officials; officials of counties, cities, or towns; local government group self-insurance pools; or court, police, or licensing officials of other states or of the federal government, provided that the information requested is for official use and such officials do not charge the Commonwealth a fee for the provision of the same or substantially similar information. The fees received by the Commissioner under this section shall be paid into the state treasury and shall be set aside as a special fund to be used to meet the expenses of the Department.</p><p>1976, c. 505, § 46.1-31.2; 1989, c. 727; 1991, c. 167; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0846" target="_blank" rel="noreferrer">846</a>; 2007, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0156" target="_blank" rel="noreferrer">156</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0447" target="_blank" rel="noreferrer">447</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0368" target="_blank" rel="noreferrer">368</a>.</p>',3),n=[i];function s(l,f,c,h,p,d){return a(),t("div",null,n)}const u=e(o,[["render",s]]);export{g as __pageData,u as default};
